import React from 'react';
import './Visualizer.css';

class Visualizer extends React.Component {
  constructor(props) {
    super(props)
  }
  //       <img src={process.env.PUBLIC_URL + '/sky.jpg'}></img>
  render() {
    return (
      <section>
        <canvas id="visualizer">
        </canvas>
        <div class="tiles"></div>
      </section>
    )
  }
}

export default Visualizer;
